}

  flex-direction: column;
}
.side-part {
  margin-top: 10px;
  height: calc(100% - 10px);
  flex: 1 1;
}

  align-items: center;
  justify-content: center;
  padding-bottom: 0;
}
.wrapper:has(div.login-img) {
  width: 90%;
  transform: translateY(0px);
  background: linear-gradient(to right, #1e90ff94 40%, #fff 40%);
  max-width: 800px;
  display: flex;
  justify-content: center;
  min-height: 528px;
  margin: 0 5%;
}
.login-img {
  width: 40%;
  display: grid;
  place-content: center;
}
.login-info {
  padding: 65px 26px 30px 26px;
  text-transform: capitalize;
  flex-grow: 1;
  max-width: 320px;
}
.login-info h3 {
  color: var(--pink-color);
  margin-bottom: 20px;
}
.login-info label {
  display: flex;
  flex-flow: column;
  position: relative;
  margin-bottom: 10px;
}
.login-info label span {
  font-size: 13px;
  margin-bottom: 7px;
  font-weight: 500;
}
.login-info input {
  padding: 5px;
  background: transparent;
  border: 1px solid #7575755c;
  margin-bottom: 7px;
  border-radius: 4px;
  color: #000;
}
.login-info input:focus {
  outline: 4px solid #f8bbd096;
}
.login-info label.password a {
  text-decoration: none;
  position: absolute;
  bottom: -16px;
  right: 4px;
}
.login-info label.password a span {
  font-size: 10px;
}
.btn-parent {
  margin: auto;
}
.btn-parent {
  display: grid;
  place-items: center;
  width: 90%;
}
.login-info button {
  margin-top: 34px;
  width: 74%;
  padding: 8px;
  color: #fff;
  background: var(--blue-color);
  font-weight: 500;
  font-size: 14px;
  border-radius: 5px;
  text-transform: capitalize;
  transition: 0.5s;
}
.login-btn:hover {
  color: var(--blue-color);
  background-color: #fff;
  border: 1px solid var(--blue-color);
}
.or {
  margin: 14px;
  text-align: center;
  text-transform: lowercase;
}
.google-log {
  margin-top: 0;
  background: transparent;
  color: #777;
  padding: 0;
  margin-bottom: 10px;
}
.google-log:hover {
  color: var(--blue-color);
}
.option {
  text-align: center;
  margin-top: 14px;
}
.option p {
  font-size: 11px;
}
.option span {
  font-weight: bold;
  text-decoration: underline;
  cursor: pointer;
  transition: 0.5s;
}
.option span:hover {
  color: var(--blue-color);
}
@media (max-width: 520px) {
  div#root:has(div.login-img) {
    padding: 20px 0px;
  }
  .wrapper:has(div.login-img) {
    flex-direction: column;
    background: linear-gradient(to bottom, var(--blue-color) 30%, #fff 30%);
  }
  .login-img {
    width: 100%;
    height: 212px;
  }
  .login-info {
    max-width: 100%;
  }
}
.errorMsg {
  text-align: end;
  font-size: 11px;
  text-transform: none;
  color: red;
}
label:has(p.errorMsg) input {
  border: 1px solid red;
}

.login-info .show_hide {
  position: absolute;
  top: 0;
  width: 20px;
  padding: 5px;
  height: 20px;
  font-size: 14px;
  right: 10px;
  transform: translateY(-50%);
  background: transparent;
  color: var(--blue-color);
}

  margin-top: 20px;
}
.profile-header {
  background-image: url(http://localhost:3000/static/media/profile-bg.31cdd919a1bd169289f5.jpg);
  height: 167px;
  border-radius: 4px;
  display: flex;
  align-items: center;
  padding: 0px 31px;
}
.profile-header img {
  width: 60px;
  height: 60px;
  border-radius: 50%;
  object-fit: cover;
}
.profileImageParent {
  position: relative;
  margin-right: 26px;
}
.profileImageParent .input-file-container {
  position: absolute;
  width: 20px;
  height: 20px;
  border-radius: 50%;
  overflow: hidden;
  bottom: 2px;
  right: 0px;
}
.profileImageParent input {
  position: absolute;
  right: 0px;
  bottom: 0px;
  opacity: 0;
  cursor: pointer;
  background: red;
  width: 120px;
}
.editIcon {
  position: absolute;
  bottom: 2px;
  right: 0px;
  color: #fff;
  background: var(--pink-color);
  border-radius: 50%;
  padding: 4px;
  width: 20px;
  height: 20px;
}
.profile-header p {
  color: #fff;
  font-weight: 400;
  text-transform: uppercase;
}
.profile-content {
  margin-top: 30px;
  display: flex;
  align-items: start;
}
.personal,
.private {
  padding-top: 20px;
  background: #1e90ff4a;
  border-radius: 10px;
  overflow: hidden;
  margin-right: 30px;
  width: 205px;
  flex-shrink: 0;
  margin-bottom: 20px;
}
.private {
  background-color: #fa4dc885;
}

.personal h3,
.private h3 {
  text-transform: capitalize;
  padding: 0px 20px;
}
.personal form,
.private form {
  display: flex;
  flex-direction: column;
  margin-top: 20px;
  padding: 15px 20px;
  background-color: #fff;
}
.personal label,
.private label {
  font-size: 12px;
  margin-bottom: 7px;
  font-weight: 500;
}
.personal input,
.private input {
  background: transparent;
  margin-bottom: 20px;
  border-bottom: 1px solid #777;
  padding-bottom: 5px;
}
.personal .inputName {
  margin-bottom: 8px;
}
.personal textarea {
  background: transparent;
  resize: none;
  border: none;
  border-bottom: 1px solid #777;
  height: 50px;
}
textarea:focus {
  outline: none;
}
.profile-email {
  font-size: 11px;
  pointer-events: none;
}
.change-password {
  position: absolute;
  top: 19px;
  right: 0px;
  font-size: 10px;
  padding: 4px;
  background: var(--blue-color);
  color: #fff;
  border-radius: 4px;
}
.password-label {
  position: relative;
}
#password {
  pointer-events: none;
}
.phone-btn {
  width: 20px;
  padding: 4px;
  height: 20px;
  border-radius: 2px;
  color: #fff;
  display: inline-grid;
  place-items: center;
}
.increase {
  background: #ce93d8;
  margin-right: 5px;
}
.decrease {
  background: darkgray;
}
.phone-container {
  position: relative;
}
.btns-container {
  position: absolute;
  top: 0;
  right: 0;
}
.profile-more {
  background: #1e90ff4a;
  display: flex;
  flex-wrap: wrap;
  padding: 5px;
  border-radius: 7px;
}
.profile-more div {
  background: #fff;
  padding: 10px;
  border-radius: 6px;
  display: grid;
  place-items: center;
  width: 100px;
  margin: 10px;
}
.profile-more h4 {
  margin-bottom: 4px;
  text-transform: capitalize;
}
.profile-more p {
  font-weight: 400;
  font-size: 20px;
}
.favorites {
}
.saveChanges {
  padding: 4px 4px;
  width: -moz-fit-content;
  width: fit-content;
  font-size: 10px;
  background: var(--blue-color);
  color: #fff;
  border-radius: 3px;
  align-self: end;
  margin-bottom: 10px;
}
.save-private {
  background: var(--pink-color);
}
button:disabled {
  opacity: 0.3;
  cursor: auto;
}
.errorMessage {
  text-align: end;
  font-size: 10px;
  text-transform: none;
  color: red;
}
@media (max-width: 760px) {
  .private {
    margin-right: 0;
  }
  .profile-content {
    flex-wrap: wrap;
    justify-content: space-between;
  }
}
@media (max-width: 684px) {
  .personal {
    margin-right: 0;
  }
  .profile-content {
    justify-content: space-around;
  }
}

  width: 255px;
}
.dish-info {
  position: relative;
}
.dish-img {
  width: 100%;
  height: 240px;
}
.dish-img img {
  width: 100%;
  height: 100%;
}
.dish-text {
  background: var(--blue-color);
  text-align: center;
  padding: 13px 0px;
  width: 90%;
  position: absolute;
  bottom: 16px;
  left: 5%;
}
.dish-text p {
  font-size: 15px;
  letter-spacing: 0.5px;
  font-weight: 600;
  color: #fff;
}
.dish-options {
  display: flex;
  flex-wrap: wrap;
  padding: 20px 15px;
  justify-content: space-between;
}
.select-container {
  width: 124px;
  position: relative;
  margin-bottom: 20px;
}
.arrow {
  position: absolute;
  top: 53%;
  right: 8px;
  display: none;
}
.arrow svg {
  font-size: 11px;
  color: var(--blue-color);
}
.select-label,
.price-label {
  text-transform: capitalize;
  font-size: 14px;
  font-weight: 600;
  margin-bottom: 6px;
}
.select {
  width: 100%;
  appearance: none;
  padding: 6px 8px;
  border: none;
  background: var(--hover-color);
  overflow: hidden;
}
.select option {
  padding: 5px;
}
.select option:checked {
  background-color: var(--pink-color);
  color: #fff;
}
.select option:hover {
  background-color: #1e90ff85;
  cursor: pointer;
}
.qty-container {
  display: inline-block;
  min-width: 40px;
  width: 10%;
  max-width: 50px;
}
.qty {
  text-transform: uppercase;
  font-size: 13px;
  font-weight: 600;
  letter-spacing: 0.4px;
  margin-bottom: 5px;
  display: block;
}
#qty {
  width: 100%;
  border: 1px solid var(--blue-color);
  text-align: center;
  padding: 3px;
  border-radius: 2px;
}
.price-amount {
}
.price-amount svg {
  color: var(--pink-color);
